function main(e){e=parseInt(e);new Vue({el:"#combine_pg",delimiters:["[[","]]"],data:{checked_:[]},methods:{post_cmb:function(){var e=this.checked_.join(", ");confirm(`Are you SURE that you want to combine the files in this order: ${e}? Note that this action is IRREVERSIBLE and the files CANNOT be separated again after you press OK`)?axios.post("/map/combine",{files:this.checked_}).then(e=>{200==e.status&&(alert("Successfully combined files"),window.location.href="/map")}).catch(e=>{console.log(e)}):this.checked_=[]}}})}